⁣
I often hear people talk about motivation as if it’s the sole driver to reaching their goals. ⁣
⁣
People often ask:⁣
⁣
“How are you so motivated all the time?” ⁣
⁣
As if my motivation is the only thing driving me. You want the truth about motivation?⁣
⁣
F^CK MOTIVATION!⁣
⁣
Motivation is a fickle and unreliable state that isn’t worth your time.⁣
⁣
What are you going to do on the day’s where you have no motivation? The day’s where you don’t want to get out of bed? The day’s where you don’t want to go to the gym?⁣
⁣
If you want something bad enough you have to earn it. You have to fight for it. ⁣
⁣
The recipe for success isn’t motivation, it’s  discipline. Accomplishing great things involves consistently doing the right thing over and over again, even when it’s hard.⁣
⁣
Discipline is reliable, motivation is momentary. The real question isn’t how to keep yourself motivated, it’s how to train yourself to work without it.⁣
⁣
It’s time you Level the F^ck up and get disciplined!

